  `ATH_TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT 'TM_SMP|Authorizer time sample',
  `CHK_TM_SMP` varchar(26) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT ' ' COMMENT 'TM_SMP|Checker time sample',
  PRIMARY KEY (`TXN_JRN`, `CHK_PTR`, `DIFF_SOUR`) USING BTREE,
  UNIQUE INDEX `UI1_T_IAS_DIFFINF`(`JRN_NO`) USING BTREE,
  INDEX `IN1_T_IAS_DIFFINF`(`MNG_STS`, `MNG_MOD`) USING BTREE,
  INDEX `NI1_T_IAS_DIFFINF`(`CRE_DT`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Difference information table' ROW_FORMAT = Dynamic;

